import React from 'react';
import "./../../css/landingPage.css";

const Footer = () => {
  return (
    <footer id="contact" className="footer">
      <p>&copy; 2024 SkillMarket. All rights reserved.</p>
      <p>
        Contact us at{' '}
        <a href="mailto:support@skillsphere.com">blessie999@gmail.com</a>
      </p>
    </footer>
  );
};

export default Footer;
